const TodoListDisplay = ()=>{
    return(
        <div>
        {notes.map(note =>
        <p key={note.id}>
          <b>{note.description}</b>
          <button onClick={() => deleteClick(note.id)}>Delete Notes</button>
        </p>
      )}
        </div>
    );
}
export default TodoListDisplay;
